export default function Footer() {
  return (
    <div className="footer-box" id='footer-box'>
        <p>Made By: Shubham Bawankar | Github: <a href="https://github.com/Shubham56-droid"><ion-icon name="logo-github"></ion-icon></a></p>
    </div>
  )
}
